import styled from 'styled-components';

export const Nav = () => {

  return(
    <Container>
      <a>About</a>
      <a>Tech-Stack</a>
      <a>Projects</a>
      <a>Contact</a>
    </Container>
  )
}

const Container = styled.div`
  width: 100%;
  background: black;
  display:flex;
`;
